function wpprfm_saveFeedData(){if(""!==jQuery("#wppfm-feed-file-name").val()&&""!==jQuery("#wpprfm-publisher-name").val()){wppfm_saveFeed()}else{jQuery("#alert-message").html("<p>"+wppfm_feed_settings_form_vars.file_name_required+"</p>");jQuery("#wppfm-success-message").show()}}function wpprfm_updateFeedFormAfterInputChanged(feedId){wpprfm_finishOrUpdateReviewFeed();if(feedId===undefined||feedId<1){wpprfm_constructNewReviewFeed()}}function wpprfm_startReviewFeedGeneration(){if(jQuery("#wppfm-feed-file-name").val()!==""){if(_reviewFeedHolder["categoryMapping"]&&_reviewFeedHolder["categoryMapping"].length>0){wpprfm_initiateSaveAndGenerateReviewFeed()}else{var userInput=confirm(wppfm_feed_settings_form_vars.no_category_selected);if(userInput===true){wpprfm_initiateSaveAndGenerateReviewFeed()}}}else{jQuery("#alert-message").html("<p>"+wppfm_feed_settings_form_vars.file_name_required+"</p>");jQuery("#wppfm-success-message").show()}}